import React from 'react';
import { createRoot } from 'react-dom/client';
import App from './App';

const root = createRoot(document.getElementById('root')); // Make sure 'root' is an existing element
root.render(<App />);

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
